void solve() {
  for (register long long i = 1; i <= 4; ++i) {
    for (register long long j = 1; j <= 8; ++j)
      if (quest(2 * i - 1, j)) return;
    for (register long long j = 8; j >= (i == 4 ? 2 : 1); --j)
      if (quest(2 * i, j)) return;
  }
