def under_attack(i, j):
    global queen_x, queen_y
    return i == queen_x or j == queen_y or i + j == queen_x + queen_y or i - j == queen_x - queen_y


class King:
    def __init__(self):
        self.x = random.randint(0, N - 1)
        self.y = random.randint(0, N - 1)
        print("king initiated ", self.x, self.y, flush=True)

    def move(self):
        choices = []
        for i in range(self.x - 1, self.x + 2):
            for j in range(self.y - 1, self.y + 2):
                if 0 <= i < N and 0 <= j < N and not under_attack(i, j):
                    choices += [[i, j]]
        try:
            choices.remove([self.x, self.y])
        except:
            pass
        if not choices:
            return "Done"
        choice = random.choice(choices)
        s = ""
        if choice[0] < self.x:
            s = 'Up'
        elif choice[0] > self.x:
            s = 'Down'
        if choice[0] != self.x and s:
            s += '-'
        if choice[1] < self.y:
            s += 'Left'
        elif choice[1] > self.y:
            s += 'Right'
        self.x, self.y = choice
        print("king moved ", s, self.x, self.y, flush=True)
        return s


def str_to_move(s: str):
    x, y = 0, 0
    if s.endswith('Right'):
        y += 1
    elif s.endswith('Left'):
        y -= 1
    if s.startswith('Down'):
        x += 1
    elif s.startswith('Up'):
        x -= 1
    return x, y


