#include <bits/stdc++.h>
using namespace std;
inline long long rd() {
  register long long res = 0, lab = 1;
  register char ch = getchar();
  while ((ch < '0' || ch > '9') && ch != EOF) {
    if (ch == '-') lab = -lab;
    ch = getchar();
  }
  while (ch >= '0' && ch <= '9')
    res = (res << 3) + (res << 1) + (ch & 15), ch = getchar();
  return res * lab;
}
inline double rdf() {
  double res = 0, g = 1;
  int lab = 1;
  char ch = getchar();
  while ((ch < '0' || ch > '9') && ch != EOF)
    lab = lab ^ (ch == '-'), ch = getchar();
  while (ch >= '0' && ch <= '9') res = res * 10 + (ch & 15), ch = getchar();
  if (ch == '.') {
    ch = getchar();
    while (ch >= '0' && ch <= '9')
      g *= 0.1, res += g * (ch & 15), ch = getchar();
  }
  return lab ? res : -res;
}
