inline long long qpow(long long n, long long e = 1000000007 - 2,
                      long long p = 1000000007) {
  n %= p;
  register long long res = 1;
  while (e) {
    if (e & 1) res = res * n % p;
    n = n * n % p;
    e >>= 1;
  }
  return res;
}
const long long ir = 1000000007 - 1;
struct cpx {
  int r, i;
  cpx(long long a = 0, long long b = 0)
      : r(a % 1000000007), i(b % 1000000007) {}
  cpx operator+(const cpx &_) const { return cpx(r + _.r, i + _.i); }
  cpx operator-(const cpx &_) const {
    return cpx(r - _.r + 1000000007, i - _.i + 1000000007);
  }
  inline cpx operator*(const cpx &_) const {
    return cpx(1ll * r * _.r + ir * i * _.i, 1ll * r * _.i + 1ll * i * _.r);
  }
};
inline cpx qpow(cpx n, long long e) {
  cpx res(1);
  while (e) {
    if (e & 1) res = res * n;
    n = n * n;
    e >>= 1;
  }
  return res;
}
struct mat {
  long long n, m, d[2 + 1][2 + 1];
  inline mat(long long n = 0, long long m = 0, long long x = 0) : n(n), m(m) {
    memset((d), 0, sizeof(d));
    for (int i = 1; i <= umin(n, m); ++i) d[i][i] = x;
  }
  inline long long *operator[](unsigned int x) { return d[x]; }
  inline mat operator*(mat _) {
    mat res(n, _.m);
    long long p = umin(m, _.n);
    for (register int i = 1; i <= n; ++i) {
      long long *pta = d[i];
      for (register int k = 1; k <= p; ++k) {
        long long *ptb = _[k];
        ++pta;
        for (register int j = 1; j <= _.m; ++j)
          pls(res[i][j], (*pta) * (*++ptb) % 1000000007);
      }
    }
    return res;
  }
};
inline mat qpow(mat n, long long e) {
  mat res(n.n, n.m, 1);
  while (e) {
    if (e & 1) res = res * n;
    n = n * n;
    e >>= 1;
  }
  return res;
}
