import java.util.Arrays;
import java.util.Scanner;

import static java.lang.Integer.max;

public class e1557 {
    public static void main(String[] args) {
        Scanner s = new Scanner(System.in);

        int tests = s.nextInt();
        for (int i = 0; i < tests; i++) solve(s);
    }


    public static void solve(Scanner s) {
        String ans;
        int vert;

        boolean p[] = new boolean[8];

        int x = 0;
        int y = 0;
        move(x, y);

        int dy = 0;

        int target;
        int targetS = 0;
        boolean first = false;
        boolean reset = false;

        while (true) {
            ans = s.next();

            if (ans.equals("Done")) return;

            vert = 0;
            if (ans.contains("U")) vert = -1;
            if (ans.contains("D")) vert = 1;
            dy += vert;

            if (vert == -1) reset = true;

            for (int i = 0; i < 8; i++) {
                if (!p[i]) p[i] = !(i + dy >= 0 && i + dy < 8 && i + dy != y);
            }

            target = -1;
            for (int i = 0; i < 8; i++) {
                if (!p[i] && target < i + dy - 1) {
                    target = max(i + dy - 1, 0);
                    targetS = i;
                    break;
                }
            }

            if (y != target || reset) {
                if (y == target) x = (x + 1) % 8;
                reset = false;
                y = target;
                first = true;
            } else {
                if (first && x != 1) {
                    x = 1;
                } else {
                    x = (x + 1) % 8;
                }
                first = false;
                if (x == 7) p[targetS] = true;
            }

            move(x, y);
            //System.out.println(Arrays.toString(p));
            //System.out.println(dy);
        }
    }

    public static void move(int x, int y) {
        x++;
        y++;
        System.out.println(y + " " + x);
    }
}

